css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("somemangas.com"), domain("somemango.com") {

body {
font-family: Lucida Grande !important;
}
img[src="/testbanner13.png"]{
float: left !important;
	height: 0 !important;
	width: 0 !important;
	/* these numbers match the new image's dimensions */
	padding-left: 125px !important;
	padding-top: 144px !important;
	background: url(data:image/png;base64,%3D%3D) no-repeat!important;
}
img[src="/centerbanner.png"]{
float: left !important;
height: 130px!important;
padding-top:10px !important;
}


#logo_div{
height: 140px !important;
width: 99.2% !important;
border: 1px solid #555555 !important;
background: -moz-linear-gradient(top,  #333333,  #444444) !important;
margin: 4px !important;
}
#ajaxsearch{
width: 100% !important;
height: 28px !important;
margin: -8px !important;
font-size: 18px !important;
font-weight: bold !important;
color: #999999;

}

span.invertible_header_inner, div.list_header_inner{
font-family: Lucida Grande !important;
font-size: 15px!important;
background: none !important;
}
.invertible_header{
background: none !important;
}
span.top_span {
font-family: Lucida Grande !important;
font-weight: bold !important;
font-size: 12px!important;
}
.list_header_inner{
background: none !important;
}
div.list_header  {
background: -moz-linear-gradient(top,  #333333,  #444444) !important;
border: 1px solid #555555 !important;
margin-bottom: 2px !important;
}
div.chunk_content{
padding: 0px !important;
width: 100% !important;

}
#recent_manga_updates_holder,.welcome_span{
padding: 8px !important;
}


.chunk_row_even, .chunk_row_odd{
margin: -8px -8px -8px -9px !important;
padding: 8px 0px 18px 0px !important;
width: 100% !important;
font-size: 12px !important;
background: -moz-linear-gradient(left,  #ffffff,  #dddddd) !important;
border: 1px solid #bbbbbb !important;
}
.chunk_row_odd{
background: -moz-linear-gradient(left,  #eeeeee,  #cccccc) !important;
}
#all_manga_holder{
margin: 0px !important;
}
.tr_row_even, tr_row_odd{
width: 100% !important;
background: -moz-linear-gradient(left,  #ffffff,  #dddddd) !important;
}
.tr_row_odd {
background: -moz-linear-gradient(left,  #eeeeee,  #cccccc) !important;
}
ul[id="jsddm"]>li{
background: none !important;
}
#top_div{
background: -moz-linear-gradient(top,  #333333,  #444444) !important;
margin: 0px !important;
}

#main_content_inner{
background: -moz-linear-gradient(top,  #222222,  #666666) !important;
margin-top: -80px !important;
}
}
